INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (0,1,2,NULL,NULL,NULL,NULL,NULL,'A modalidade foi instituída oficialmente no pais em 31 de julho de 1897, data em que os clubes Botafogo, Gragoata, Icarai e Flamengo fundaram a União de Regatas Fluminense, na cidade do Rio de Janeiro, renomeado mais tarde como Conselho Superior de Regatas e, por fim, confederação brasileira de natação\nAs primeiras disputas ocorriam na Baía de Guanabara.\n\nPorém, antes disso, a primeira competição oficial que se tem registro é a travessia da Baía de Guanabara, no Rio de Janeiro. Ela ocorreu em uma disputa entre Joaquim Antonio Souza, de 19 anos, de Niterói, e um relojoeiro alemão Theodor John, de 50, no ano de 1881. A cada ano, os dois voltavam a disputar a prova, com cada vez mais pessoas, que aderiam à manifestação esportiva.[1]\n\nEm 1885, quatro anos depois do início das disputas, a primeira piscina brasileira foi construída às margens do rio Guaíba, em Porto Alegre, Rio Grande do Sul, a qual recebeu o nome de Badeanstalf, ou também basenho, pela Sociedade Ginástica Deutsher Turnverein.[1]\n\nO primeiro Campeonato Brasileiro, na modalidade 1500m nado livre, com o percurso da fortaleza Villegaignon até a praia de Santa Luzia, é disputado em 1898,[2] tendo como campeão Abrahão Saliture. A Federação, localizada em Botafogo, passa a divulgar o Campeonato Brasileiro em 1913, ano em que são disputadas as provas de 100m para estreantes, 600m para seniores e 200m para juniores. Em 1914, o controle do esporte e as competições em território brasileiro passam para a Confederação Brasileira de Desportos.[3]\n\nEm 1 de outubro de 1904, é disputado o primeiro interestadual de natação que se tem notícia. O Clube Espéria, de São Paulo, organizou uma festa desportiva onde possuía uma raia de 350 metros de distância. Abrahão Saliture, competindo pelo Clube de Natação e Regatas, do Rio de Janeiro, acabou como campeão.[4]\n\nUm ano depois, em 1905, iniciaram-se as competições de natação do rio Tietê, em comemoração do aniversário do Espéria, evento que se repetiria até os anos 1920. Entre as disputas de remo, provas de 100 e 350 metros eram travadas. Os grandes destaques dos anos que antecederam a Primeira Guerra Mundial eram Guilherme Schollz, Walter von Kutzleben e José Rubião, mas esses não eram páreo para Saliture, que comparecia como convidado e jamais foi superado. Saliture chegou a participar dos Jogos Olímpicos de 1920, na Antuérpia.[4] ',1,NULL,NULL,'2019-05-16 00:53:56',NULL,1);
INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (1,1,1,NULL,NULL,NULL,NULL,NULL,'MENSAGEM DO PRESIDENTE\r\n\r\nQuando tomei a decisão de me candidatar ao cargo de presidente da Confederação Brasileira de Basketball, sabia que teria muitos desafios, que nossa equipe precisaria de muita dedicação para recolocar o basquetebol brasileiro no merecido local de destaque no cenário mundial, mas sabia, também, da importância não apenas de buscar novas conquistas, mas de valorizar as glórias dos “heróis” que trouxeram tantas alegrias aos amantes do nosso esporte. Homens e mulheres que, por amor ao basquetebol, se dedicaram, superaram dificuldades, venceram adversários em partidas onde nossos atletas eram “Davi” diante de “Golias”. \r\nEu, que sou ex-atleta, e também faço parte dessa história, hoje, ocupando a função de Presidente da entidade máxima do basquetebol nacional, considero-me na obrigação de fazer esse reconhecimento trazendo aos amantes do esporte um pouco dessa história, que será contada através de imagens.\r\nTerei eternamente orgulho de ter ocorrido na minha gestão à frente da CBB a realização da parceria com a conceituada Universidade do Estado do Rio de Janeiro – UERJ, para a construção do E-MUSEU, o Museu Nacional do Esporte, onde faz parte o Museu do Basquetebol.\r\nAproveito a oportunidade para parabenizar atletas, membros de comissão técnica, dirigentes e todos os envolvidos, dentro e fora das quadras, que fazem parte da história do basquetebol nacional, que nos deu tanta alegria e emoção.\r\nA importância deste trabalho se traduz na citação de Cícero:\r\n “A história é testemunha do passado, luz da verdade, vida da memória, mestra da vida, anunciadora dos tempos antigos”.\r\nPor fim, agradeço à Universidade do Estado do Rio de Janeiro – UERJ pela parceria e o incansável esforço na construção desse projeto. Desejamos caminhar juntos no crescimento do E-MUSEU, fomentando o aumento de seu acervo e engrandecendo a memória do esporte nacional. \r\n\r\nGuy Rodrigues Peixoto Junior.',1,NULL,NULL,'2019-04-08 15:10:16',NULL,1);
