INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (63,1,2,NULL,NULL,NULL,NULL,NULL,'A modalidade foi instituída oficialmente no pais em 31 de julho de 1897, data em que os clubes Botafogo, Gragoata, Icarai e Flamengo fundaram a União de Regatas Fluminense, na cidade do Rio de Janeiro, renomeado mais tarde como Conselho Superior de Regatas e, por fim, confederação brasileira de natação\nAs primeiras disputas ocorriam na Baía de Guanabara.\n\nPorém, antes disso, a primeira competição oficial que se tem registro é a travessia da Baía de Guanabara, no Rio de Janeiro. Ela ocorreu em uma disputa entre Joaquim Antonio Souza, de 19 anos, de Niterói, e um relojoeiro alemão Theodor John, de 50, no ano de 1881. A cada ano, os dois voltavam a disputar a prova, com cada vez mais pessoas, que aderiam à manifestação esportiva.[1]\n\nEm 1885, quatro anos depois do início das disputas, a primeira piscina brasileira foi construída às margens do rio Guaíba, em Porto Alegre, Rio Grande do Sul, a qual recebeu o nome de Badeanstalf, ou também basenho, pela Sociedade Ginástica Deutsher Turnverein.[1]\n\nO primeiro Campeonato Brasileiro, na modalidade 1500m nado livre, com o percurso da fortaleza Villegaignon até a praia de Santa Luzia, é disputado em 1898,[2] tendo como campeão Abrahão Saliture. A Federação, localizada em Botafogo, passa a divulgar o Campeonato Brasileiro em 1913, ano em que são disputadas as provas de 100m para estreantes, 600m para seniores e 200m para juniores. Em 1914, o controle do esporte e as competições em território brasileiro passam para a Confederação Brasileira de Desportos.[3]\n\nEm 1 de outubro de 1904, é disputado o primeiro interestadual de natação que se tem notícia. O Clube Espéria, de São Paulo, organizou uma festa desportiva onde possuía uma raia de 350 metros de distância. Abrahão Saliture, competindo pelo Clube de Natação e Regatas, do Rio de Janeiro, acabou como campeão.[4]\n\nUm ano depois, em 1905, iniciaram-se as competições de natação do rio Tietê, em comemoração do aniversário do Espéria, evento que se repetiria até os anos 1920. Entre as disputas de remo, provas de 100 e 350 metros eram travadas. Os grandes destaques dos anos que antecederam a Primeira Guerra Mundial eram Guilherme Schollz, Walter von Kutzleben e José Rubião, mas esses não eram páreo para Saliture, que comparecia como convidado e jamais foi superado. Saliture chegou a participar dos Jogos Olímpicos de 1920, na Antuérpia.',1,NULL,NULL,'2019-05-16 00:53:56',NULL,1);
INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (64,2,1,NULL,2340,NULL,'JOGADOR - GUY PEIXOTO',NULL,'Aos 11 anos Guy Peixoto foi chamado para integrar as categorias de base do Clube do Remo, onde esteve por nove anos e se destacou em todas as categorias, sempre campeão. Ali começava a brilhar a nova estrela do basquete brasileiro. \r\nConquistou o título de campeão brasileiro adulto e chegou a Seleção Paulista para jogar ao lado de nomes importantes do basquete nacional, como Israel Andrade e Cadum Guimarães.\r\nSendo convocado para a seleção brasileira de categorias de base, o paraense sagrou-se vice-campeão Mundial Sub-19.\r\nPelo time do Monte Líbano foi Campeão Brasileiro Adulto e Taça Brasil de Clubes, na equipe treinada por Amaury Passos. \r\nHoje, Guy Peixoto exerce a função de Presidente da Confederação Brasileira de Basketball - CBB.',1,NULL,NULL,'2019-05-28 02:27:39',NULL,1);
INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (65,1,4,NULL,NULL,NULL,'Biografia usuario magicpaula@cbb.com.br','Biografia do perfil criado para Magic Paula','Maria Paula Gonçalves da Silva (Osvaldo Cruz, 11 de março de 1962) é uma jogadora de basquetebol brasileira, mais conhecida como Paula ou Magic Paula (em referência ao jogador americano Magic Johnson). É considerada uma das melhores jogadoras que o basquete produziu segundo artigo site Terceiro tempo https://terceirotempo.bol.uol.com.br/que-fim-levou/paula-a-magic-paula-4095\n\nCarreira\n\nPaula começou a jogar com apenas dez anos de idade e destacou-se tanto que, em 1974, foi convidada pelo técnico do Assis Tênis Clube para integrar o time da cidade.\n\nPaula jogou tanto como armadora, e mostrou eficiência fazendo assistências, cobrando lances livres e convertendo cestas de três pontos. Após um ano e meio, o time acabou. Paula foi então para Jundiaí, jogar na equipe do Colégio Divino Salvador. Passados três meses, com apenas catorze anos, foi convocada pela primeira vez para a seleção brasileira adulta. Depois de quatro anos no Divino, já consagrada, Paula transferiu-se para a\n\nUniversidade Metodista de Piracicaba.[1][1] Lá jogou durante oito anos, até que voltou para o Cica/Divino Salvador. Pouco tempo depois, a jogadora resolveu dar uma guinada na carreira e aceitou a proposta do time espanhol Tintoretto. Porém, uma lesão no joelho e uma certa dificuldade de adaptação ao estilo de treino da equipe espanhola colaboraram para que Magic Paula voltasse ao Brasil, em 1991, quando vestiu a camisa do BCN/Piracicaba.\n\nNos Jogos Pan-americanos de Havana, realizados em 1991, a seleção brasileira feminina disputou as finais do torneio com as próprias cubanas e Fidel Castro compareceu ao jogo. Nesse jogo, Magic Paula brilhou no segundo tempo: fez cinco arremessos de três pontos e acertou quatro, e as brasileiras venceram por 97 a 76. Na entrega da medalha de ouro, Fidel Castro pediu para Paula ficar de costas e apontando para sua camisa, fez um gesto negativo com o dedo como se tivesse a intenção de não entregar o ouro à atleta e, brincando, chamou-a de \"bruxa\".\n\nEm 1993, Paula foi para a Associação Atlética Ponte Preta, em Campinas, onde jogou ao lado de Hortência e conquistou o título mundial de clubes. Após certos confrontos pessoais com Hortência, Paula voltou à Piracicaba para defender o Unimep. Em 1994, ela conquistou o título inédito do campeonato mundial de seleções, realizado na Austrália, onde a seleção brasileira derrotou os Estados Unidos, na semifinal, por 110 a 107, e a China na partida decisiva, por 96 a 87.\n\nEm 1996, já jogando pelo Microcamp, além de ser campeã paulista pela oitava vez, brilhou novamente na seleção nos Jogos Olímpicos de Atlanta, conquistando a medalha de prata. Despediu-se da seleção brasileira, mas continuou na quadra, disputando os campeonatos paulistas e nacionais, até o adeus definitivo, com a camisa do BCN/Osasco, no início de 2000.\n\nApós o encerramento da carreira no basquete, Paula teve uma curta participação no Ministério do Esporte. Foi convidada para assumir a Secretaria Nacional de Alto Rendimento do Ministério do Esporte, porém a passagem pelo órgão Federal durou apenas 158 dias. Paula pediu demissão após um polêmico incidente no qual ficou constatado que o Comitê Olímpico Brasileiro (COB) pagou a estadia de membros do Ministério durante a realização dos Jogos Pan-americanos de Santo Domingo.\n\nEm 2004 Magic Paula fundou o Instituto Passe de Mágica, organização sem fins lucrativos, em Piracicaba. Com a missão de contribuir para o desenvolvimento humano por meio da cultura da prática esportiva, fortalecendo vínculos comunitários e promovendo qualidade de vida, atende hoje quase 900 crianças em três cidades do Estado de São Paulo sendo: 2 Núcleos em Piracicaba, onde iniciou o instituto; 3 Núcleos em São Paulo e 2 Núcleo em Diadema. Em cada núcleo são atendidos semanalmente cerca de 120 crianças e adolescentes entre 6 e 17 anos no contra-turno escolar. Os projetos contam com o aporte de Leis de Incentivo (Paulista e Federal) e apoios de algumas empresas com aporte direto. Em 2017 o instituto iniciou um Projeto de Formação Profissional - F5 no Vale do Ribeira, atendendo cerca de 20 municípios, contribuindo e potencializando as políticas públicas das cidades, com uma equipe especializada.\n\nEm novembro de 2005, Magic Paula foi oficialmente confirmada para integrar o Hall da Fama do Basquete Feminino e, em abril de 2006, ela embarcou para Knoxville, no Tennessee, para participar da cerimônia.\n\nEm dezembro de 2010, foi agraciada com a comenda da Ordem do Ipiranga pelo Governo do Estado de São Paulo.\n\nPaula é a segunda maior pontuadora da história da seleção brasileira adulta, tendo marcado 2.537 pontos em 150 partidas oficiais (foi a que mais jogou), média de 16,9 pontos por partida.',1,NULL,NULL,'2019-05-29 04:17:54',NULL,1);
INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (66,1,5,NULL,NULL,NULL,'Biografia usuario norminha@cbb.com.br','Biografia do perfil criado para Norminha','Norma Pinto de Oliveira, mais conhecida como Norminha (Buenos Aires, 13 de maio de 1942) foi uma jogadora de basquetebol brasileira, mas nascida na Argentina[1][2][3]. Filha de pai brasileiro e mãe argentina, Norminha veio com 13 anos de idade para o Brasil, naturalizando-se mais tarde.\n\nDefendendo as cores da Seleção Brasileira de Basquetebol Feminino, foi medalhista de bronze no Mundial Feminino de Basquetebol de 1971, e tri-medalhista em Jogos Pan-americanos: Prata em São Paulo (Brasil - 1963), Ouro em Winnipeg (Canadá - 1967) e Ouro em Cali (Colômbia - 1971).',1,NULL,NULL,'2019-05-29 04:22:55',NULL,1);
INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (67,1,6,NULL,NULL,NULL,'Biografia usuario paulinhovilasboas@cbb.com.br','Biografia do perfil criado para Paulinho Villas Boas','Paulo Villas Boas de Almeida (São Paulo, 26 de janeiro de 1963) é basquetebolista brasileiro, com diversas passagens pela seleção brasileira. Atualmente, é comentarista da (Fox Sports).\n\n- Principais conquistas pela seleção brasileira\n\n5º lugar nos Jogos Olímpicos de Seul (Coréia – 1988)\n5º lugar nos Jogos Olímpicos de Barcelona (Espanha – 1992)\nCampeão no Torneio Pré-Olímpico das Américas (Brasil – 1984)\nCampeão no Torneio Pré-Olímpico das Américas (Uruguai – 1988)\n3º lugar no Torneio Pré-Olímpico das Américas (Estados Unidos – 1992)\n4º lugar no Campeonato Mundial (Espanha – 1986)\n11º lugar no Campeonato Mundial(Canadá – 1994)\nMedalha de ouro nos Jogos Pan-Americanos de Indianápolis (Estados Unidos – 1987)\n5º lugar nos Jogos Pan-Americanos de Mar del Plata (Argentina – 1991)\nCampeão Sul-Americano (Colômbia – 1985)\nCampeão Sul-Americano (Equador – 1989)\nVice-campeão Sul-Americano (Venezuela – 1991)\nCampeão Sul-Americano(Brasil – 1993)\n3º lugar no Campeonato Mundial Juvenil (Espanha – 1983)\nVice-campeão na Copa Pan-Americana Juvenil (Argentina – 1980)\nCampeão na Copa Pan-Americana Juvenil (Brasil – 1982)\nVice-campeão Sul-Americano Juvenil (Venezuela – 1981)\n3º lugar no Campeonato Sul-Americano Juvenil (Uruguai – 1982)',1,NULL,NULL,'2019-05-29 04:26:22',NULL,1);
INSERT INTO `evento` (`id`, `evento_tipo_id`, `usuario_id`, `evento_id`, `multimedia_id_capa`, `slug`, `titulo`, `descricao`, `historia`, `autorizacao`, `data_inicio_evento`, `data_fim_evento`, `data_criacao`, `data_atualizacao`, `ativo`) VALUES (68,1,7,NULL,NULL,NULL,'Biografia usuario wlamirmarques@cbb.com.br','Biografia do perfil criado para Wlamir Marques','Wlamir Marques (São Vicente, 16 de julho de 1937) é um jogador de basquetebol brasileiro. Fez parte da geração de ouro do basquete nacional bicampeã mundial em 1959 em Santiago, no Chile, e em 1963 no Rio de Janeiro.\n\nNos dias atuais, divide-se nas funções de professor de Educação Física e comentarista da ESPN Brasil, canal de TV fechada. Ganhou o título de Cidadão Emérito de São Vicente, sua cidade natal. Foi premiado com o Cruz do Mérito Esportivo (1953), Troféu Heims de Melhor Atleta da América do Sul (1961) e a Medalha do Mérito Esportivo. A edição brasileira da Revista ESPN apontou Wlamir Marques como 9º maior atleta brasileiro de todos os tempos, em uma lista de 50 nomes publicada em novembro de 2010.\n\nCarreira pela seleção\nÉ considerado um dos maiores jogadores de basquete da história do Brasil, juntamente com ídolos como Amaury Pasos, Algodão, Rosa Branca e Ubiratan liderou a geração mais vitoriosa do basquete brasileiro durante as décadas de 50 e 60, quando a seleção foi bicampeã mundial. Ganhou dois apelidos logo no começo de sua carreira: Disco Voador e Diabo Loiro, o mais famoso[2].\n\nÉ multimedalhista: possui quatro medalhas dos mundiais de basquete, sendo duas de ouro e duas de prata, além de dois bronzes olímpicos, um nos Jogos de Roma-1960 e outro nos Jogos de Tóquio-1964. Além dele, Kresimir Cosic, outro multimedalhista em Campeonatos Mundiais de Basquete da FIBA, possui dois ouros e 2 medalhas de pratas.\n\nEm âmbito continental, medalha de prata nos Jogos Pan-Americanos de 1963 e medalha de bronze nos Jogos Pan-Americanos de 1955 e Jogos Pan-Americanos de 1959.\n\nPossui quatro medalhas de ouro do Campeonato Sul-Americano de Basquetebol Masculino.',1,NULL,NULL,'2019-05-29 04:30:12',NULL,1);
