INSERT INTO `evento_tipo` (`id`, `nome`, `descricao`, `data_criacao`, `data_atualizacao`, `ativo`, `slug`) VALUES (1,'Biografia','A Biografia (do grego antigo: ????????? , de ?í?? - bíos, vida e ??????? – gráphein, escrever) é um gênero literário em que o autor narra a história da vida de uma pessoa ou de várias pessoas. De um modo geral as biografias contam a vida de alguém. Em certos casos a biografia inclui aspectos da obra dos biografados, como por exemplo Plutarco, em suas Bíoi parálleloi (Vidas paralelas), numa abordagem muitas vezes de um ponto de vista crítico e não apenas historiográfico. Em francês, o termo biographie é documentado em 1721; no inglês, a palavra biography foi documentada em 1791 e na forma biographia já em 1683; em espanhol, biografía, e, em português, biografia aparecem somente na segunda metade do século XIX. Mais recentemente é comum se solicitar a biodata de pessoas que produzem trabalhos artísticos, científicos etc. Este termo remete à vida e às experiências de trabalho do biodatado, bem como a itens que revelem suas opiniões, valores, crenças e atitudes. Os dados biográficos transcritos nesta categoria contêm, por vezes, o mesmo tipo da informação que um resumo de trabalho acadêmico, podendo também incluir a descrição dos atributos físicos e fotos.','2019-03-25 21:15:58',NULL,1,NULL);
INSERT INTO `evento_tipo` (`id`, `nome`, `descricao`, `data_criacao`, `data_atualizacao`, `ativo`, `slug`) VALUES (2,'Prêmio','Prêmiações, títulos ou conquistas','2019-04-09 22:22:20',NULL,1,NULL);
